import{_ as a}from"./chunks/cube_black_hero.BEQPwC1z.js";import{_ as e,a as t}from"./chunks/cube_ports_usb_sdcard.DjqeRsN_.js";import{_ as r}from"./chunks/cube_ports_debug.rfpatbdm.js";import{_ as l,c as i,o,ab as s}from"./chunks/framework.CUflZczI.js";const S=JSON.parse('{"title":"Польотний контролер Hex Cube Black","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/pixhawk-2.md","filePath":"uk/flight_controller/pixhawk-2.md"}'),h={name:"uk/flight_controller/pixhawk-2.md"},d=s('<h1 id="польотнии-контролер-hex-cube-black" tabindex="-1">Польотний контролер Hex Cube Black <a class="header-anchor" href="#польотнии-контролер-hex-cube-black" aria-label="Permalink to &quot;Польотний контролер Hex Cube Black&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4 не виробляє цей (чи будь-який інший) автопілот. Звертайтесь до <a href="https://cubepilot.org/#/home" target="_blank" rel="noreferrer">виробника</a> щодо питань апаратного забезпечення або питань відповідності.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p><a href="./cubepilot_cube_orange.html">Cube Orange</a> є наступником цього продукту. Ми проте рекомендуємо врахувати продукти, зроблені відповідно до стандартів галузі, таких як <a href="./autopilot_pixhawk_standard.html">Стандарти Pixhawk</a>. Цей контролер польоту не дотримується стандарту і використовує патентований роз&#39;єм.</p></div><p>Контролер польоту <a href="http://www.proficnc.com/61-system-kits2" target="_blank" rel="noreferrer">Hex Cube Black</a> (раніше відомий як Pixhawk 2.1) - це гнучкий автопілот, призначений в першу чергу для виробників комерційних систем. Він базується на відкритому апаратному дизайні <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk-project</a> <strong>FMUv3</strong> та запускає PX4 на операційній системі <a href="https://nuttx.apache.org/" target="_blank" rel="noreferrer">NuttX</a> OS.</p><p><img src="'+a+'" alt="Cube Black"></p><p>Контролер призначений для використання зі специфічною для домену несучою платою, щоб зменшити кількість дротів, підвищити надійність і спростити збірку. Наприклад, несуча плата для комерційного інспекційного апарату може містити з&#39;єднання для комп&#39;ютера-компаньйона, в той час як несуча плата для гонщика може включати ESC з рами транспортного засобу.</p><p>Cube має віброізоляцію на двох ІВП, з третім фіксованим ІВП в якості еталонного/резервного.</p><div class="info custom-block"><p class="custom-block-title">Документація ввід виробника <a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-module-overview" target="_blank" rel="noreferrer">Cube Docs</a> містить детальну інформацію, включаючи огляд <a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-module-overview#differences-between-cube-colours" target="_blank" rel="noreferrer">Різниць між Cube Colours</a>.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Цей автопілот <a href="./../flight_controller/autopilot_pixhawk_standard.html">підтримується</a> командами підтримки та тестування PX4.</p></div><h2 id="ключові-особливості" tabindex="-1">Ключові особливості <a class="header-anchor" href="#ключові-особливості" aria-label="Permalink to &quot;Ключові особливості&quot;">​</a></h2><ul><li>32bit STM32F427 <a href="http://en.wikipedia.org/wiki/ARM_Cortex-M#Cortex-M4" target="_blank" rel="noreferrer">Cortex-M4F</a><sup>®</sup> ядро з FPU</li><li>168 MHz / 252 MIPS</li><li>256 KB RAM</li><li>2 MB Flash (повністю доступна)</li><li>32 bit STM32F103 відмовостійкий співпроцесор</li><li>14 ШІМ / серво виходів (8 з відмовостійкими і ручним керуванням, 6 допоміжних, сумісних з великими потужностями)</li><li>Широкі можливості підключення додаткових периферійних пристроїв (UART, I2C, CAN)</li><li>Інтегрована система резервного копіювання для відновлення в польоті та ручного керування з виділеним процесором та автономним джерелом живлення (для літаків з фіксованим крилом)</li><li>Резервна система інтегрує систему міксування, забезпечуючи узгоджені режими автопілота та ручного заміщення ( для літаків з фіксованим крилом)</li><li>Резервні входи живлення та автоматичне перемикання на резервне джерело</li><li>Зовнішній запобіжний вимикач</li><li>Головний візуальний індикатор - мультиколірний світлодіод</li><li>Потужний мультитональний п&#39;єзозвуковий індикатор</li><li>Карта microSD для високошвидкісної фіксації даних протягом тривалого періоду часу</li></ul><p><a id="stores"></a></p><h2 id="де-придбати" tabindex="-1">Де придбати <a class="header-anchor" href="#де-придбати" aria-label="Permalink to &quot;Де придбати&quot;">​</a></h2><p><a href="http://www.proficnc.com/61-system-kits" target="_blank" rel="noreferrer">Cube Black</a> (ProfiCNC)</p><h2 id="збірка" tabindex="-1">Збірка <a class="header-anchor" href="#збірка" aria-label="Permalink to &quot;Збірка&quot;">​</a></h2><p><a href="./../assembly/quick_start_cube.html">Швидке підключення Cube</a></p><h2 id="характеристики" tabindex="-1">Характеристики <a class="header-anchor" href="#характеристики" aria-label="Permalink to &quot;Характеристики&quot;">​</a></h2><h3 id="процесор" tabindex="-1">Процесор <a class="header-anchor" href="#процесор" aria-label="Permalink to &quot;Процесор&quot;">​</a></h3><ul><li>32bit STM32F427 <a href="http://en.wikipedia.org/wiki/ARM_Cortex-M#Cortex-M4" target="_blank" rel="noreferrer">Cortex M4</a> ядро з FPU</li><li>168 MHz / 252 MIPS</li><li>256 KB RAM</li><li>2 MB Flash (повністю доступна)</li><li>32 bit STM32F103 відмовостійкий співпроцесор</li></ul><h3 id="сенсори" tabindex="-1">Сенсори <a class="header-anchor" href="#сенсори" aria-label="Permalink to &quot;Сенсори&quot;">​</a></h3><ul><li>TBA</li></ul><h3 id="інтерфеиси" tabindex="-1">Інтерфейси <a class="header-anchor" href="#інтерфеиси" aria-label="Permalink to &quot;Інтерфейси&quot;">​</a></h3><ul><li>5x UART (послідовні порти), один високої потужності, 2x з контролем потоку HW</li><li>2x CAN (один з внутрішнім 3.3В трансивером, один на конекторі розширювача)</li><li>Spektrum DSM / DSM2 / DSM-X® Satellite сумісний вхід</li><li>Futaba S.BUS® сумісний вхід і вивід</li><li>Вхід сигналу PPM sum</li><li>Вхід RSSI (PWM або напруга)</li><li>I2C</li><li>SPI</li><li>3.3В АЦП вхід</li><li>Внутрішній порт microUSB і розширення зовнішнього порту microUSB</li></ul><h3 id="система-живлення-та-захист" tabindex="-1">Система живлення та захист <a class="header-anchor" href="#система-живлення-та-захист" aria-label="Permalink to &quot;Система живлення та захист&quot;">​</a></h3><ul><li>Ідеальний діодний контролер з автоматичним перемиканням на резервне живлення</li><li>Сервопривід високої потужності (max. 10В) і сильного струму (10A+)</li><li>Усі периферійні виводи захищені від перевантаження по струму, усі входи захищені від електростатичного розряду</li></ul><h3 id="номінальна-напруга" tabindex="-1">Номінальна напруга <a class="header-anchor" href="#номінальна-напруга" aria-label="Permalink to &quot;Номінальна напруга&quot;">​</a></h3><p>Pixhawk може мати потрійну резервність у джерелі живлення, якщо подаються три джерела живлення. Три шини: вхід модуля живлення, вхід сервоприводу, вхід USB.</p><h4 id="максимальна-напруга-нормальноі-роботи" tabindex="-1">Максимальна напруга нормальної роботи <a class="header-anchor" href="#максимальна-напруга-нормальноі-роботи" aria-label="Permalink to &quot;Максимальна напруга нормальної роботи&quot;">​</a></h4><p>За таких умов всі джерела живлення будуть використовуватися в цьому порядку для живлення системи</p><ul><li>Вхід модуля живлення (4.8В до 5.4В)</li><li>Вхід сервоприводу (4.8V to 5.4V) <strong>ДО 10В ДЛЯ РУЧНОГО ПЕРЕКЛЮЧЕННЯ, АЛЕ АВТОПІЛОТ БУДЕ ЗНЕЖИВЛЕНИЙ ВИЩЕ 5.7В, ЯКЩО ВХІД МОДУЛЯ ЖИВЛЕННЯ ВІДСУТНІЙ</strong></li><li>Вхід живлення USB (4.8В до 5.4В)</li></ul><h4 id="абсолютна-максимальна-напруга" tabindex="-1">Абсолютна максимальна напруга <a class="header-anchor" href="#абсолютна-максимальна-напруга" aria-label="Permalink to &quot;Абсолютна максимальна напруга&quot;">​</a></h4><p>За таких умов система не буде витрачати жодної енергії (не буде працювати), але залишиться неушкодженою.</p><ul><li>Вхід модуля живлення (4.1В до 5.7В, 0В до 20В неушкоджений)</li><li>Вхід сервоприводу (4.1В до 5.7В, 0В до 20В)</li><li>Вхід живлення USB (4.1В до 5.7В, 0В до 6В)</li></ul><h2 id="розпіновки-та-схеми" tabindex="-1">Розпіновки та схеми <a class="header-anchor" href="#розпіновки-та-схеми" aria-label="Permalink to &quot;Розпіновки та схеми&quot;">​</a></h2><p>Схеми плат та іншу документацію можна знайти тут: <a href="https://github.com/proficnc/The-Cube" target="_blank" rel="noreferrer">Проект Cube</a>.</p><h2 id="порти" tabindex="-1">Порти <a class="header-anchor" href="#порти" aria-label="Permalink to &quot;Порти&quot;">​</a></h2><h3 id="верхня-частина-gps-telem-тощо" tabindex="-1">Верхня частина (GPS, TELEM тощо) <a class="header-anchor" href="#верхня-частина-gps-telem-тощо" aria-label="Permalink to &quot;Верхня частина (GPS, TELEM тощо)&quot;">​</a></h3><p><img src="'+e+'" alt="Cube Ports - Top (GPS, TELEM etc) and Main/AUX"></p><p><a id="serial_ports"></a></p><h3 id="зіставлення-послідовних-портів" tabindex="-1">Зіставлення послідовних портів <a class="header-anchor" href="#зіставлення-послідовних-портів" aria-label="Permalink to &quot;Зіставлення послідовних портів&quot;">​</a></h3><table><thead><tr><th>UART</th><th>Device</th><th>Port</th></tr></thead><tbody><tr><td>USART1</td><td>/dev/ttyS0</td><td></td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (flow control)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (flow control)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>PX4IO</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>CONSOLE</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td></td></tr></tbody></table><h3 id="відладочні-порти" tabindex="-1">Відладочні порти <a class="header-anchor" href="#відладочні-порти" aria-label="Permalink to &quot;Відладочні порти&quot;">​</a></h3><p><img src="'+r+'" alt="Cube Debug Ports"></p><h3 id="порти-usb-sdcard" tabindex="-1">Порти USB/SDCard <a class="header-anchor" href="#порти-usb-sdcard" aria-label="Permalink to &quot;Порти USB/SDCard&quot;">​</a></h3><p><img src="'+t+'" alt="Cube USB/SDCard Ports"></p><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Більшості користувачів не потрібно збирати цю прошивку! Вона попередньо зібрана і автоматично встановлюється за допомогою <em>QGroundControl</em> при підключенні відповідного обладнання.</p></div><p>Щоб <a href="./../dev_setup/building_px4.html">зібрати PX4</a> для цієї цілі:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make px4_fmu-v3_default</span></span></code></pre></div><h2 id="проблеми" tabindex="-1">Проблеми <a class="header-anchor" href="#проблеми" aria-label="Permalink to &quot;Проблеми&quot;">​</a></h2><p>Розташування сілкскрінів CAN1 і CAN2 на Cube Black перевернуте (CAN1 - це CAN2 і навпаки).</p><h2 id="додаткова-інформація-документація" tabindex="-1">Додаткова інформація/документація <a class="header-anchor" href="#додаткова-інформація-документація" aria-label="Permalink to &quot;Додаткова інформація/документація&quot;">​</a></h2><ul><li><a href="./../assembly/quick_start_cube.html">Швидке підключення Cube</a></li><li>Cube Docs (виробник): <ul><li><a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-module-overview" target="_blank" rel="noreferrer">Огляд модуля Cube</a></li><li><a href="https://docs.cubepilot.org/user-guides/autopilot/the-cube-user-manual" target="_blank" rel="noreferrer">Посібник користувача Cube</a></li><li><a href="https://docs.cubepilot.org/user-guides/carrier-boards/mini-carrier-board" target="_blank" rel="noreferrer">Міні-платформа</a></li></ul></li></ul>',53),c=[d];function u(n,p,b,m,k,f){return o(),i("div",null,c)}const C=l(h,[["render",u]]);export{S as __pageData,C as default};
